import React, { useState } from 'react';

const WorldMap = ({ articles, onRegionSelect }) => {
  const [highlightedRegion, setHighlightedRegion] = useState(null);

  // Count articles per region
  const articleCounts = articles.reduce((acc, article) => {
    const region = article.fields.geographicLocation;
    acc[region] = (acc[region] || 0) + 1;
    return acc;
  }, {});

  // Get color intensity based on article count
  const getRegionColor = (region) => {
    const count = articleCounts[region] || 0;
    const maxCount = Math.max(...Object.values(articleCounts), 1);
    const intensity = count ? Math.max(0.2, count / maxCount) : 0.1;
    return `rgba(16, 185, 129, ${intensity})`; // emerald-500 with varying opacity
  };

  return (
    <div className="bg-white rounded-lg shadow-md p-4 mb-6">
      <div className="flex items-center justify-between mb-2">
        <h2 className="text-lg font-medium text-slate-800">Global Story Distribution</h2>
        <div className="flex items-center text-sm text-slate-500">
          <span className="w-3 h-3 bg-emerald-500 rounded-full mr-1"></span>
          Story density
        </div>
      </div>

      <div className="relative w-full" style={{ maxHeight: '300px' }}>
        <svg 
          viewBox="0 0 1000 500" 
          className="w-full h-auto max-h-[300px]"
          style={{ backgroundColor: '#f8fafc' }} // slate-50
        >
          {/* North America */}
          <path
            d="M135,120 L175,110 L215,108 L285,115 L295,145 L285,165 L255,170 L245,190 L225,195 L205,185 L185,180 L165,170 L145,160 L135,150 Z"
            fill={getRegionColor('North America')}
            stroke="#e2e8f0"
            strokeWidth="1"
            onMouseEnter={() => setHighlightedRegion('North America')}
            onMouseLeave={() => setHighlightedRegion(null)}
            onClick={() => onRegionSelect('North America')}
            className="cursor-pointer transition-colors duration-300 hover:fill-emerald-600"
          />

          {/* South America */}
          <path
            d="M235,230 L255,240 L265,270 L255,300 L235,320 L215,310 L205,290 L215,260 Z"
            fill={getRegionColor('South America')}
            stroke="#e2e8f0"
            strokeWidth="1"
            onMouseEnter={() => setHighlightedRegion('South America')}
            onMouseLeave={() => setHighlightedRegion(null)}
            onClick={() => onRegionSelect('South America')}
            className="cursor-pointer transition-colors duration-300 hover:fill-emerald-600"
          />

          {/* Europe */}
          <path
            d="M420,120 L460,110 L490,115 L505,125 L495,145 L465,150 L435,145 L415,135 Z"
            fill={getRegionColor('Europe')}
            stroke="#e2e8f0"
            strokeWidth="1"
            onMouseEnter={() => setHighlightedRegion('Europe')}
            onMouseLeave={() => setHighlightedRegion(null)}
            onClick={() => onRegionSelect('Europe')}
            className="cursor-pointer transition-colors duration-300 hover:fill-emerald-600"
          />

          {/* Africa */}
          <path
            d="M435,180 L465,175 L495,185 L505,215 L485,245 L455,255 L435,245 L425,215 Z"
            fill={getRegionColor('Africa')}
            stroke="#e2e8f0"
            strokeWidth="1"
            onMouseEnter={() => setHighlightedRegion('Africa')}
            onMouseLeave={() => setHighlightedRegion(null)}
            onClick={() => onRegionSelect('Africa')}
            className="cursor-pointer transition-colors duration-300 hover:fill-emerald-600"
          />

          {/* Asia */}
          <path
            d="M525,115 L625,125 L645,145 L635,175 L595,185 L565,175 L535,165 L525,145 Z"
            fill={getRegionColor('Asia')}
            stroke="#e2e8f0"
            strokeWidth="1"
            onMouseEnter={() => setHighlightedRegion('Asia')}
            onMouseLeave={() => setHighlightedRegion(null)}
            onClick={() => onRegionSelect('Asia')}
            className="cursor-pointer transition-colors duration-300 hover:fill-emerald-600"
          />

          {/* Oceania */}
          <path
            d="M665,245 L695,255 L685,275 L665,280 L655,265 Z"
            fill={getRegionColor('Oceania')}
            stroke="#e2e8f0"
            strokeWidth="1"
            onMouseEnter={() => setHighlightedRegion('Oceania')}
            onMouseLeave={() => setHighlightedRegion(null)}
            onClick={() => onRegionSelect('Oceania')}
            className="cursor-pointer transition-colors duration-300 hover:fill-emerald-600"
          />

          {/* Region Labels */}
          <g className="pointer-events-none">
            <text x="215" y="145" className="text-xs fill-slate-700" textAnchor="middle">North America</text>
            <text x="235" y="280" className="text-xs fill-slate-700" textAnchor="middle">South America</text>
            <text x="465" y="125" className="text-xs fill-slate-700" textAnchor="middle">Europe</text>
            <text x="465" y="215" className="text-xs fill-slate-700" textAnchor="middle">Africa</text>
            <text x="585" y="145" className="text-xs fill-slate-700" textAnchor="middle">Asia</text>
            <text x="675" y="265" className="text-xs fill-slate-700" textAnchor="middle">Oceania</text>
          </g>
        </svg>

        {/* Tooltip */}
        {highlightedRegion && articleCounts[highlightedRegion] > 0 && (
          <div className="absolute top-4 right-4 bg-white shadow-lg rounded-lg p-2 text-sm border border-slate-100">
            <h3 className="font-medium text-slate-800">{highlightedRegion}</h3>
            <p className="text-slate-600">{articleCounts[highlightedRegion]} stories</p>
          </div>
        )}

        {/* Legend */}
        <div className="absolute bottom-4 right-4 bg-white/80 backdrop-blur-sm rounded-lg p-2 text-xs">
          <div className="flex items-center gap-4">
            <div className="flex items-center">
              <span className="inline-block w-3 h-3 bg-emerald-200 rounded-sm mr-1"></span>
              <span className="text-slate-600">Few stories</span>
            </div>
            <div className="flex items-center">
              <span className="inline-block w-3 h-3 bg-emerald-500 rounded-sm mr-1"></span>
              <span className="text-slate-600">Many stories</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default WorldMap;
